import React from "react";

const heading = {
        backgroundcolor: "#f5ba13",
        margin: "auto -16px",
        padding: "16px 32px",
        boxshadow: "0 0 10px 0 rgba(0, 0, 0, 0.3)"
      
}

function Head(){
    return(
        <div style={heading}>
            <h1>Keeper</h1>
        </div>
    )
}

export default Head;
